import React from "react"
import ReactDOM from "react-dom"
import "./index.css"
import App from "./App"

// For React 17 and earlier, use ReactDOM.render
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById("root"),
)

// Note: The following code is for React 18, but you're using an earlier version
